import React from 'react';
import logo from './logo.svg';
import './App.css';

function Sobre() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          SOBRE SOBRE SOBRE
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          SOBRE SOBRE SOBRE
        </a>
      </header>
    </div>
  );
}

export default Sobre;
